{
  "translationLines": [
    {
      "lineNumber": 213972,
      "originalJapaneseLine": "「うわーお、テキパキ……」",
      "translatedEnglishLine": "\"Wow, so efficient...\""
    },
    {
      "lineNumber": 213973,
      "originalJapaneseLine": "「えへへ……」",
      "translatedEnglishLine": "\"Hehe...\""
    },
    {
      "lineNumber": 213974,
      "originalJapaneseLine": "事件当夜、ロッキーの部屋の窓は",
      "translatedEnglishLine": "On the night of the incident, Rocky's room window was"
    },
    {
      "lineNumber": 213975,
      "originalJapaneseLine": "開きっぱなしだったらしい。",
      "translatedEnglishLine": "apparently left wide open."
    },
    {
      "lineNumber": 213976,
      "originalJapaneseLine": "手がかり『開いていた窓』を手に入れた。",
      "translatedEnglishLine": "Obtained clue: \"Open window.\""
    },
    {
      "lineNumber": 213977,
      "originalJapaneseLine": "事件当夜、盗みに入られた客室のほとんどは、",
      "translatedEnglishLine": "On the night of the incident, most of the guest rooms that were robbed"
    },
    {
      "lineNumber": 213978,
      "originalJapaneseLine": "鍵は施錠されておらず扉も開きっぱなしだった。",
      "translatedEnglishLine": "were not locked and the doors were left open."
    },
    {
      "lineNumber": 213979,
      "originalJapaneseLine": "手がかり『事件当時の客室のドア』を手に入れた。",
      "translatedEnglishLine": "Obtained clue: \"Guest room doors at the time of the incident.\""
    },
    {
      "lineNumber": 213980,
      "originalJapaneseLine": "「あくまでも探偵は私がするから安心して、",
      "translatedEnglishLine": "\"Rest assured, I will be the detective after all,"
    },
    {
      "lineNumber": 213981,
      "originalJapaneseLine": "　＜エール＞ちゃんは手伝ってくれればいいからね」",
      "translatedEnglishLine": "and <Yell>-chan, you just have to help me out.\""
    },
    {
      "lineNumber": 213982,
      "originalJapaneseLine": "「さ、次に行こう行こーう」",
      "translatedEnglishLine": "\"Now, let's move on, let's go!\""
    },
    {
      "lineNumber": 213983,
      "originalJapaneseLine": "「うーん、当日のアリバイ調査は",
      "translatedEnglishLine": "\"Hmm, the alibi investigation for that day"
    },
    {
      "lineNumber": 213984,
      "originalJapaneseLine": "　こんなところかな？」",
      "translatedEnglishLine": "is about this much, I suppose?\""
    },
    {
      "lineNumber": 213985,
      "originalJapaneseLine": "「これによると、事件当夜、",
      "translatedEnglishLine": "\"According to this, on the night of the incident,"
    },
    {
      "lineNumber": 213986,
      "originalJapaneseLine": "　魔王ランスの襲撃により、",
      "translatedEnglishLine": "due to the Demon King Lance's attack,"
    },
    {
      "lineNumber": 213987,
      "originalJapaneseLine": "　宿屋内は極端に人がいなかった」",
      "translatedEnglishLine": "the inn was extremely deserted.\""
    },
    {
      "lineNumber": 213988,
      "originalJapaneseLine": "「犯行が可能だったのは……",
      "translatedEnglishLine": "\"Those who could have possibly committed the crime were..."
    },
    {
      "lineNumber": 213989,
      "originalJapaneseLine": "　＜エール＞ちゃんの仲間の面々、",
      "translatedEnglishLine": "<Yell>-chan's group of friends,"
    },
    {
      "lineNumber": 213990,
      "originalJapaneseLine": "　それから志津香さん、ナギちゃん」",
      "translatedEnglishLine": "and also Shizuka-san and Nagi-chan.\""
    },
    {
      "lineNumber": 213991,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 213992,
      "originalJapaneseLine": "「？　他は？」",
      "translatedEnglishLine": "\"? What about the others?\""
    },
    {
      "lineNumber": 213993,
      "originalJapaneseLine": "「……これだけでした」",
      "translatedEnglishLine": "\"...That's all there was.\""
    },
    {
      "lineNumber": 213994,
      "originalJapaneseLine": "「えっ！？」",
      "translatedEnglishLine": "\"Eh!?\""
    },
    {
      "lineNumber": 213995,
      "originalJapaneseLine": "「つ、つまり……",
      "translatedEnglishLine": "\"S-So... "
    },
    {
      "lineNumber": 213996,
      "originalJapaneseLine": "　この中に犯人が！？」",
      "translatedEnglishLine": "the culprit is among us!?\""
    },
    {
      "lineNumber": 213997,
      "originalJapaneseLine": "「長田君……自首すれば罪は軽くなるよ？」",
      "translatedEnglishLine": "\"Nagata-kun... if you turn yourself in, your punishment will be lighter, you know?\""
    },
    {
      "lineNumber": 213998,
      "originalJapaneseLine": "「いや、やってねぇっすよ！？」",
      "translatedEnglishLine": "\"No, I didn't do it!\""
    },
    {
      "lineNumber": 213999,
      "originalJapaneseLine": "「って、冗談は置いといて。",
      "translatedEnglishLine": "\"Anyway, jokes aside."
    },
    {
      "lineNumber": 214000,
      "originalJapaneseLine": "　私達しか犯人になりえないってのは……",
      "translatedEnglishLine": "The fact that only we could be the culprits is..."
    },
    {
      "lineNumber": 214001,
      "originalJapaneseLine": "　ちょーっとまずいねぇ」",
      "translatedEnglishLine": "a bit problematic.\""
    },
    {
      "lineNumber": 214002,
      "originalJapaneseLine": "「あ、宿の人は調べた？」",
      "translatedEnglishLine": "\"Ah, did you check the inn staff?\""
    },
    {
      "lineNumber": 214003,
      "originalJapaneseLine": "「支配人も警備員も",
      "translatedEnglishLine": "\"Both the manager and the security guard"
    },
    {
      "lineNumber": 214004,
      "originalJapaneseLine": "　宿屋のマスターキー持ってて、",
      "translatedEnglishLine": "have the inn's master keys,"
    },
    {
      "lineNumber": 214005,
      "originalJapaneseLine": "　どこにだって入り放題だし怪しくない？」",
      "translatedEnglishLine": "so they can enter anywhere freely, doesn't that seem suspicious?\""
    },
    {
      "lineNumber": 214006,
      "originalJapaneseLine": "「うん、ちゃんと調べたよ」",
      "translatedEnglishLine": "\"Yeah, I checked properly.\""
    },
    {
      "lineNumber": 214007,
      "originalJapaneseLine": "「宿のマスターキーを",
      "translatedEnglishLine": "\"The master keys of the inn"
    },
    {
      "lineNumber": 214008,
      "originalJapaneseLine": "　持ってるのは支配人と警備員の二人だけ」",
      "translatedEnglishLine": "are held by only two people: the manager and the security guard.\""
    },
    {
      "lineNumber": 214009,
      "originalJapaneseLine": "「ただ、支配人さんはその時間、",
      "translatedEnglishLine": "\"However, the manager at that time"
    },
    {
      "lineNumber": 214010,
      "originalJapaneseLine": "　仕事で会食の最中でずっと近くに人がいたって」",
      "translatedEnglishLine": "was in a business dinner and had people near him the whole time.\""
    },
    {
      "lineNumber": 214011,
      "originalJapaneseLine": "「警備員さんは事件当夜、避難誘導やらで忙しく",
      "translatedEnglishLine": "\"The security guard, on the night of the incident, was busy with evacuation guidance and such,"
    },
    {
      "lineNumber": 214012,
      "originalJapaneseLine": "　動き回っていたからアリバイのない時間も",
      "translatedEnglishLine": "and was moving around, so he does have some times without an alibi,"
    },
    {
      "lineNumber": 214013,
      "originalJapaneseLine": "　あるにはあるけど……」",
      "translatedEnglishLine": "he does, but...\""
    },
    {
      "lineNumber": 214014,
      "originalJapaneseLine": "「すぐに宿屋を出たから、",
      "translatedEnglishLine": "\"He left the inn quickly,"
    },
    {
      "lineNumber": 214015,
      "originalJapaneseLine": "　盗みに入られた部屋全部はとても回れないって」",
      "translatedEnglishLine": "so it is impossible for him to have checked all the robbed rooms.\""
    },
    {
      "lineNumber": 214016,
      "originalJapaneseLine": "「うーん、二人ともアリバイがあるかぁ……」",
      "translatedEnglishLine": "\"Hmm, both have alibis, huh...\""
    },
    {
      "lineNumber": 214017,
      "originalJapaneseLine": "「じゃあ外部犯？」",
      "translatedEnglishLine": "\"Then was it an outsider?\""
    },
    {
      "lineNumber": 214018,
      "originalJapaneseLine": "「は、ちょっと考えにくいって」",
      "translatedEnglishLine": "\"H-Hard to imagine.\""
    },
    {
      "lineNumber": 214019,
      "originalJapaneseLine": "「魔王ランスの騒ぎでこの宿屋の周りは",
      "translatedEnglishLine": "\"Because of the commotion caused by Demon King Lance,"
    },
    {
      "lineNumber": 214020,
      "originalJapaneseLine": "　都市警備隊が厳戒態勢を敷いていたから、",
      "translatedEnglishLine": "the city guard had the area around this inn on high alert,"
    },
    {
      "lineNumber": 214021,
      "originalJapaneseLine": "　人っ子一人入れなかったの」",
      "translatedEnglishLine": "and not a single person could have gotten in.\""
    },
    {
      "lineNumber": 214022,
      "originalJapaneseLine": "「うむむむ……",
      "translatedEnglishLine": "\"Hmmmm..."
    },
    {
      "lineNumber": 214023,
      "originalJapaneseLine": "　このままだと私達が犯人だねぇ……",
      "translatedEnglishLine": "At this rate, it looks like we are the culprits...\""
    },
    {
      "lineNumber": 214024,
      "originalJapaneseLine": "　包囲網が狭まっていくねぇ」",
      "translatedEnglishLine": "\"The noose is tightening.\""
    },
    {
      "lineNumber": 214025,
      "originalJapaneseLine": "「アリバイがなくて犯行可能な奴、",
      "translatedEnglishLine": "\"Someone without an alibi who could have committed the crime,"
    },
    {
      "lineNumber": 214026,
      "originalJapaneseLine": "　私、もう一人知ってるわよ」",
      "translatedEnglishLine": "I know one more person.\""
    },
    {
      "lineNumber": 214027,
      "originalJapaneseLine": "「マジすか！？」",
      "translatedEnglishLine": "\"Seriously!?\""
    },
    {
      "lineNumber": 214028,
      "originalJapaneseLine": "「魔王ランス」",
      "translatedEnglishLine": "\"Demon King Lance.\""
    },
    {
      "lineNumber": 214029,
      "originalJapaneseLine": "「あ、それいい！",
      "translatedEnglishLine": "\"Ah, that’s great!"
    },
    {
      "lineNumber": 214030,
      "originalJapaneseLine": "　ランスが犯人ってことにしよう！",
      "translatedEnglishLine": "Let’s just say Lance is the culprit!"
    },
    {
      "lineNumber": 214031,
      "originalJapaneseLine": "　これでロッキー救えるよ！」",
      "translatedEnglishLine": "This way we can save Rocky!\""
    }
  ]
}

